    <audio autoplay loop onloadeddata="var audioPlayer = this; setTimeout(function() { audioPlayer.play(); }, 400)">
        <source src="./clock.wav" type="audio/mpeg">
    </audio>

    <script>
        var i;
        setInterval(function () {

            var myTime = new Date();

            var h = myTime.getHours();
            var m = myTime.getMinutes();
            var s = myTime.getSeconds();

            if (s % 2 == 1) {
                i = 0;
                i++;
                i += 7;
                rightEye.style.transform = 'translateX(-' +
                    i + 'px)';
                leftEye.style.transform = 'translateX(' +
                    i + 'px)';
                rightEye_1_.style.transform = 'translateX(-' +
                    i + 'px)';
                leftEye_1_.style.transform = 'translateX(' +
                    i + 'px)';
                rightCircle.style.fill = '#fff';
                leftCircle.style.fill = '#30799B';
            } else {
                if (i > 0) {
                    i--;
                }
                i = 0;
                i += 7;
                rightEye.style.transform = 'translateX(' +
                    i + 'px)';
                leftEye.style.transform = 'translateX(-' +
                    i + 'px)';
                rightEye_1_.style.transform = 'translateX(' +
                    i + 'px)';
                leftEye_1_.style.transform = 'translateX(-' +
                    i + 'px)';
                leftCircle.style.fill = '#fff';
                rightCircle.style.fill = '#30799B';
            }

            if (h > 12) {
                timeStatus = 'PM';
                tStatus.innerHTML = 'pm';
            } else {
                timeStatus = 'AM';
                tStatus.innerHTML = 'am';
            }

            if (h > 12) {
                h = h - 12;
            }

            if (h < 10) {
                h = '0' + h;
            }

            if (m < 10) {
                m = '0' + m;
            }
            if (s < 10) {
                s = '0' + s;
            }

            hours.innerHTML = h;
            minutes.innerHTML = m;
            seconds.innerHTML = s;

        }, 1000);

    </script>
